    "\"%(title)s\" is required to send":"\"%(title)s\" est obligatoire pour l'envoi",
    "\"Eventbrite allows us to 'spin up' new events quickly, freeing time to focus on the quality of our events, not managing attendees. We love it!\"":"\u00ab Eventbrite nous fait gagner du temps. Ainsi, nous pouvons nous concentrer sur la qualit\u00e9 de nos \u00e9v\u00e9nements plut\u00f4t que sur la gestion des invit\u00e9s. Parfait ! \u00bb",
    "\"Eventbrite brings our checkout to where our fans already are, rather than that the other way around. This takes our promotional efforts to the next level.\"":"\u00ab Eventbrite am\u00e8ne notre r\u00e8glement l\u00e0 o\u00f9 nos fans se trouvent d\u00e9j\u00e0 plut\u00f4t que de les faire aller d'un endroit \u00e0 un autre. Cela \u00e9l\u00e8ve nos efforts promotionnels \u00e0 un niveau sup\u00e9rieur. \u00bb",
    "\"Eventbrite gives us a robust, world class event technology platform that truly puts the power in my hands.\"":"\u00ab Eventbrite nous apporte une plateforme de technologie \u00e9v\u00e9nementielle fiable et de classe mondiale qui me permet vraiment de garder le contr\u00f4le. \u00bb",
    "\"Eventbrite helped us grow quickly. We were able to ramp up in multiple countries without worrying about international payment.\"":"\u00ab Eventbrite nous a aid\u00e9 \u00e0 nous d\u00e9velopper rapidement. Nous avons pu nous adapter \u00e0 plusieurs pays sans avoir \u00e0 nous occuper du paiement \u00e0 l'international. \u00bb",
    "\"Eventbrite just improves every aspect of your festival exponentially.\"":"\u00ab Eventbrite ne fait qu'am\u00e9liorer chaque aspect de votre festival de mani\u00e8re exponentielle. \u00bb",
    "\"Eventbrite's live reporting has made a huge difference to our business. We've been able to boost sales while actually saving money on marketing.\"":"\u00ab Les rapports en direct d'Eventbrite font vraiment la diff\u00e9rence pour notre activit\u00e9. Nous avons pu booster nos ventes tout en r\u00e9alisant de belles \u00e9conomies sur le marketing. \u00bb",
    "\"Eventbrite's system provides valuable insights through its reporting tools, and simply saves us a lot of time.\"":"\u00ab Le syst\u00e8me d'Eventbrite fournit des renseignements pr\u00e9cieux par le biais de ses outils analytiques, et nous permet tout simplement de gagner \u00e9norm\u00e9ment de temps. \u00bb",
    "\"Eventbrite\u2019s product is leading the market. We wanted to align ourselves with a ticketing partner that is moving in the right direction the fastest, and Eventbrite is constantly innovating to achieve that goal.\"":"\u00ab Le produit Eventbrite domine le march\u00e9. Nous voulions \u00eatre accompagn\u00e9s d'un partenaire de billetterie allant dans la bonne direction le plus rapidement possible, et Eventbrite est constamment en train d'innover pour atteindre cet objectif. \u00bb",
    "\"I didn't expect our classes to take off as fast as they did. Eventbrite allowed us to turn our passion into a business overnight.\"":"\u00ab Je ne m'attendais pas \u00e0 ce que nos cours connaissent un succ\u00e8s aussi rapide. Eventbrite nous a permis de transformer notre passion en un v\u00e9ritable m\u00e9tier, du jour au lendemain. \u00bb",
    "\"I get at least 2 emails a day from people who found us through Eventbrite, which is potentially $2,000 - $3,000 in revenue. It's incredible.\"":"\u00ab Je re\u00e7ois au moins 2 e-mails par jour de personnes qui nous ont trouv\u00e9s via Eventbrite, ce qui repr\u00e9sente potentiellement entre 2 000 et 3 000 euros. C'est incroyable. \u00bb",
    "\"If I was starting a dance studio right now, I would tell you that you have to get on Eventbrite to expose yourself to more walk-in traffic.\"":"\u00ab Si vous planifiez de lancer une \u00e9cole de danse maintenant, je vous conseillerais d'aller sur Eventbrite pour vous faire conna\u00eetre \u00e0 un public potentiel. \u00bb",
    "\"Not only does Eventbrite make our pages reflect our brand, they also make it really easy for attendees to sign up both online and through mobile.\"":"\u00ab Eventbrite permet de refl\u00e9ter notre marque sur nos pages mais \u00e9galement aux participants de s'inscrire vraiment facilement en ligne ou depuis un appareil mobile. \u00bb",
    "\"Not only has Eventbrite helped us figure out how to grow painlessly, but it\u2019s given us a better understanding of where our attendees are coming from and how they\u2019re finding out about our events.\"":"\u00ab Non seulement Eventbrite nous a aid\u00e9 \u00e0 nous d\u00e9velopper sans difficult\u00e9s, mais aussi \u00e0 mieux comprendre d'o\u00f9 venaient nos participants et comment ils trouvaient nos \u00e9v\u00e9nements. \u00bb",
    "\"Now that we understand what specific student identity is coming to our events, we can market them better, and we've seen our conversion rates improve because of this.\"":"\u00ab Maintenant que nous comprenons que des profils sp\u00e9cifiques d'\u00e9tudiants viennent \u00e0 nos \u00e9v\u00e9nements, nous pouvons mieux les cibler et nous avons am\u00e9lior\u00e9 nos taux de conversion gr\u00e2ce \u00e0 cela. \u00bb",
    "\"Technology just needs to work and Eventbrite does, no issues.\"":"\u00ab La technologie se doit de fonctionner et Eventbrite fonctionne sans probl\u00e8me. \u00bb",
    "\"The Eventbrite interface is easy to use. For nonprofits, it\u2019s a great central hub for all your events.\"":"\u00ab L'interface Eventbrite est simple \u00e0 utiliser. Pour les organisations \u00e0 but non lucratif, c'est une excellente plaque tournante pour tous vos \u00e9v\u00e9nements. \u00bb",
    "\"The amount of time Eventbrite saves me to focus on other things is amazing.\"":"\u00ab C'est incroyable le temps que j'ai gagn\u00e9 avec Eventbrite pour me concentrer sur d'autres choses. \u00bb",
    "\"There is no better team on the ground during our event than the Eventbrite staff members who ensure everything runs smoothly and that we have a great event.  The work Eventbrite does is HEROIC.\"":"\u00ab Il n'y a pas eu de meilleure \u00e9quipe au monde pendant notre \u00e9v\u00e9nement que l'\u00e9quipe Eventbrite qui s'est assur\u00e9e que tout se d\u00e9roule sans encombre et que nous passions un agr\u00e9able \u00e9v\u00e9nement. Le travail d'Eventbrite a \u00e9t\u00e9 H\u00c9RO\u00cfQUE. \u00bb",
    "\"We've virtually doubled our numbers since 2013. Eventbrite has been with us the whole way.\"":"\u00ab Nous avons presque doubl\u00e9 nos chiffres depuis 2013. Eventbrite nous accompagne depuis nos d\u00e9buts. \u00bb",
    "\"What Eventbrite has been, for me, it has been so much more than just a platform, it's been a partnership.\"":"\u00ab Eventbrite a \u00e9t\u00e9 pour moi au-del\u00e0 d'une plateforme, un partenaire ! \u00bb",
