    "\u003ch4\u003eFor more advanced ticketing needs try calculating your payout using the \u003ca class=\"eds-btn--link eds-btn--anchor eds-link\" id=\"assortmentLink\"\u003eProfessional package\u003c/a\u003e.\u003c/h4\u003e":"\u003ch4\u003ePour des besoins en billetterie plus avanc\u00e9s, essayez de calculer votre paiement en utilisant le \u003ca class=\"eds-btn--link eds-btn--anchor eds-link\" id=\"assortmentLink\"\u003eforfait Professional\u003c/a\u003e.\u003c/h4\u003e",
    "\u003ch4\u003eFor simpler ticketing and lower fees, try calculating your payout using the \u003ca id=\"assortmentLink\" class=\"eds-btn--link eds-btn--anchor eds-link\"\u003eEssentials package\u003c/a\u003e.\u003c/h4\u003e":"\u003ch4\u003ePour une billetterie plus simple et des frais r\u00e9duits, essayez de calculer votre paiement en utilisant le \u003ca id=\"assortmentLink\" class=\"eds-btn--link eds-btn--anchor eds-link\"\u003eforfait Essentials\u003c/a\u003e.\u003c/h4\u003e",
    "\u003cp\u003eDoes any of the following apply to you or your event:\u003c/p\u003e\n            \u003cp class=\"eds-text-weight--light\"\u003e(i) my event is a 10k, half-marathon, marathon, fun run, walk, wheelchair race, bicycle race, triathlon, or any other similar non-motorized race, or\u003c/p\u003e\n            \u003cp class=\"eds-text-weight--light\"\u003e(ii) my event is a school event or function held by a public or private school (grades kindergarten through 12) and the net proceeds are used solely for the benefit of such public or private school or its students, or\u003c/p\u003e\n            \u003cp class=\"eds-text-weight--light\"\u003e(iii) I\u2019m a religious institution or denomination offering a fundraising event, the proceeds from which will be used exclusively for any of the following charitable purposes: church-related youth activities, religious instruction or worship, construction or repair of church buildings or facilities, or relief for the elderly?\u003c/p\u003e":"\u003cp\u003eEst-ce que l'un des \u00e9l\u00e9ments suivants s'applique \u00e0 vous ou \u00e0 votre \u00e9v\u00e9nement :\u003c/p\u003e\n        \u003cp class=\"eds-text-weight--light\"\u003e(i) mon \u00e9v\u00e9nement est une course de 10 km, un semi-marathon, un marathon, une course amicale, une course \u00e0 pied, une marche, une course en fauteuil roulant, une course \u00e0 bicyclette, un triathlon ou toute autre course non motoris\u00e9e semblable, ou\u003c/p\u003e\n       \u003cp class=\"eds-text-weight--light\"\u003e (ii) mon \u00e9v\u00e9nement est un \u00e9v\u00e9nement scolaire ou une fonction tenue par une \u00e9cole publique ou priv\u00e9e (de la maternelle \u00e0 l'\u00e2ge de 12 ans) et les recettes sont utilis\u00e9es uniquement pour le b\u00e9n\u00e9fice de cette \u00e9cole publique ou priv\u00e9e ou de ses \u00e9l\u00e8ves, \u003c/p\u003e\n      \u003cp class=\"eds-text-weight--light\"\u003e(iii) je suis une institution religieuse ou une d\u00e9nomination qui propose une collecte de fonds, dont les recettes seront utilis\u00e9es exclusivement \u00e0 l\u2019une des fins de bienfaisance suivantes : les activit\u00e9s paroissiales pour la jeunesse, l'instruction religieuse ou le culte, la construction ou la r\u00e9paration d'\u00e9difices ou d'installations de l'\u00e9glise, ou l'aide aux personnes \u00e2g\u00e9es ?\u003c/p\u003e",
    "\u003cp\u003eEventbrite, as a marketplace provider, assumes the rights and duties of a seller or retailer under Chapter 151 of the Texas Tax Code with respect to sales made by you through the Eventbrite platform.\u003c/p\u003e\u003cbr/\u003e\n            \u003cp\u003eBased on the location of your event, we need you to answer the following quick question(s):\u003c/p\u003e":"\u003cp\u003eEventbrite,  en tant que fournisseur de place de march\u00e9, assume les droits et les responsabilit\u00e9s d'un vendeur ou d'un d\u00e9taillant conform\u00e9ment au Chapitre 151 du Code des taxes du Texas relatif aux ventes effectu\u00e9es par vous par le biais de la plateforme.\u003c/p\u003e\u003cbr/\u003e\n            \u003cp\u003eSur la base du lieu de votre \u00e9v\u00e9nement, vous devez r\u00e9pondre aux questions br\u00e8ves suivantes :\u003c/p\u003e",
