    "\u003cspan class='text-significant'\u003eNEW:\u003c/span\u003e You just changed the name or price of an on-sale ticket. \u003ca href='%(helpLink)s' target='_blank'\u003eLearn what that means\u003c/a\u003e for your event.":"\u003cspan class='text-significant'\u003eNOUVEAUT\u00c9 :\u003c/span\u003e vous venez de changer le nom ou le prix d'un billet en vente. \u003ca href='%(helpLink)s' target='_blank'\u003eD\u00e9couvrez ce que cela signifie\u003c/a\u003e pour votre \u00e9v\u00e9nement.",
