    "If attendees are dissatisfied with an account credit, they may file chargebacks with their bank. Event organizers are responsible for chargeback costs.":"Si les participants ne sont pas satisfaits avec du cr\u00e9dit sur compte, ils pourront contester le paiement aupr\u00e8s de leur banque. Les organisateurs d'\u00e9v\u00e9nements sont responsables des co\u00fbts li\u00e9s aux contestations de paiement.",
