    "If buyers request refunds on Eventbrite, single ticket orders will be refunded without review, while funds are available":"Si les acheteurs demandent des remboursements sur Eventbrite, les commandes contenant un seul billet seront rembours\u00e9es sans v\u00e9rification, tant que les fonds sont disponibles",
