    "If the event is private, password-protected or a parent event for a series event won't be listed in the performance table":"Si l'\u00e9v\u00e9nement est priv\u00e9 et prot\u00e9g\u00e9 par un mot de passe ou un \u00e9v\u00e9nement apparent\u00e9 \u00e0 une s\u00e9rie, l'\u00e9v\u00e9nement ne sera pas list\u00e9 dans le tableau des performances",
    "If the issue(s) are fixed, you can try to add your event to Facebook again.":"Si le ou les probl\u00e8mes ne sont pas r\u00e9solus, vous pouvez essayer d'ajouter \u00e0 nouveau votre \u00e9v\u00e9nement \u00e0 Facebook.",
    "If the issue(s) are fixed, you can try to add your tickets to Facebook again.":"Si le ou les probl\u00e8mes sont r\u00e9solus, vous pouvez essayer d'ajouter \u00e0 nouveau votre \u00e9v\u00e9nement \u00e0 Facebook.",
    "If this email is incorrect, please manually add a new contact":"Si cet e-mail n'est pas correct, veuillez ajouter un nouveau contact",
