    "Make sure you're using an accepted file format. There's no need to label your columns (but you can if you want)\u2014 email go into the first column (A), first name in the second (B), and last name in the third column (C). If you only have email addresses, that's fine. You can also edit your contacts first and last name later.":"Assurez-vous d'avoir utiliser un format de fichier accept\u00e9. Il n'est pas utile de mettre des titres \u00e0 vos colonnes, commencez simplement par le premier e-mail dans la premi\u00e8re cellule (A), le pr\u00e9nom dans la cellule (B) de la deuxi\u00e8me colonne et le nom de famille dans la cellule (C) de la troisi\u00e8me colonne. Si vous n'avez que les adresses e-mail, cela suffit. Vous pourrez \u00e9galement modifier vos contacts plus tard.",
    "Make sure you're using an accepted file format. There's no need to label your columns\u2014just start with your first email address in the first cell (A1), first name in the second column cell (B1), and last name in the third column cell (C1). If you only have email addresses, that's fine. You can also edit your contacts later.":"Assurez-vous d'avoir utiliser un format de fichier accept\u00e9. Il n'est pas utile de mettre des titres \u00e0 vos colonnes, commencez simplement par le premier e-mail dans la premi\u00e8re cellule (A1), le pr\u00e9nom dans la cellule (B1) de la deuxi\u00e8me colonne et le nom de famille dans la cellule (C1) de la troisi\u00e8me colonne. Si vous n'avez que les adresses e-mail, cela suffit. Vous pourrez \u00e9galement modifier vos contacts plus tard.",
    "Make sure your CSV is formatted with email addresses in the first column (A), first names in the second column (B), and last names in the third column (C). Only email addresses are required.":"Assurez-vous que votre fichier CSV est format\u00e9 avec les adresses e-mails dans la premi\u00e8re colonne (A), les pr\u00e9noms dans la deuxi\u00e8me colonne (B), et les noms de famille dans la troisi\u00e8me colonne (C). Seuls les adresses e-mails sont obligatoires.",
