    "We\u2019ve been notified by the Internal Revenue Service that the taxpayer information (Taxpayer Name and Taxpayer Identification Number) you provided does not match their records.  Please re-submit your taxpayer information as soon as possible.  Please note that until this is resolved, we are required by U.S. tax laws to withhold on your payouts.":"L'Internal Revenue Service nous a avis\u00e9s que les renseignements du contribuable (Nom du Contribuable et Num\u00e9ro d\u2019Identification du Contribuable) ne correspondaient pas \u00e0 ceux contenus dans leurs dossiers. Veuillez soumettre de nouveau vos renseignements de contribuable d\u00e8s que possible. Veuillez noter que, jusqu'\u00e0 ce que cette question soit r\u00e9solue, nous sommes tenus par les lois fiscales am\u00e9ricaines de retenir vos paiements.",
    "We\u2019ve been notified by the Internal Revenue Service twice within the past three years that the taxpayer information (Taxpayer Name and Taxpayer Identification Number) you provided does not match their records.  You\u2019ll receive a notice via email which provides additional information to help you resolve this issue. Please note that until this is resolved, we are required by U.S. tax laws to withhold on your payouts. \u003ca href=\"/support/contact-us\" target=\"_blank\" rel=\"noopener noreferrer\"\u003eContact us\u003c/a\u003e 24/7 if you have any questions":"L'administration fiscale nous a notifi\u00e9s \u00e0 deux reprises lors des trois derni\u00e8res ann\u00e9es que les renseignements fiscaux (Nom de Contribuable et Num\u00e9ro d'Identification Fiscale) que vous nous avez fournis sur Eventbrite ne correspondaient pas aux informations contenues dans leurs dossiers. Vous recevrez une notification par e-mail avec des informations suppl\u00e9mentaires pour vous aider \u00e0 r\u00e9soudre ce probl\u00e8me. Veuillez prendre en compte que tant que ce probl\u00e8me n'est pas r\u00e9solu, nous sommes dans l'obligation, conform\u00e9ment \u00e0 la l\u00e9gislation fiscale am\u00e9ricaine, de retenir vos paiements. \u003ca href=\"/support/contact-us\" target=\"_blank\" rel=\"noopener noreferrer\"\u003eContactez-nous\u003c/a\u003e 24 h/24, 7 j/7 si vous avez des questions.",
