    "When using Eventbrite's payment processing, you have the option to either \"absorb\" your fees and pay them out of your ticketing revenue, or pass them along to your ticket buyers. The majority of organisers who pass fees to their buyers pay nothing out of pocket to use Eventbrite! If you choose to use a third party payment processor (such as PayPal), you'll be \u003ca href=\"/support/articles/en_AU/Troubleshooting/understanding-eventbrite-fee-invoices?lg=en_AU\"\u003einvoiced\u003c/a\u003e for your fees.":"En utilisant le traitement des paiements Eventbrite, vous avez la possibilit\u00e9 d'inclure vos frais et de les payer sur vos recettes de billetterie, ou de les transf\u00e9rer aux acheteurs de vos billets. La plupart des organisateurs qui transf\u00e8rent les frais aux acheteurs ne paient au final rien en utilisant Eventbrite ! Si vous choisissez d'utiliser un processeur de paiements tiers (comme PayPal), vous serez \u003ca href=\"/support/articles/en_AU/Troubleshooting/understanding-eventbrite-fee-invoices?lg=en_AU\"\u003efactur\u00e9\u003c/a\u003e pour vos frais.",
    "When using Eventbrite's payment processing, you have the option to either \"absorb\" your fees and pay them out of your ticketing revenue, or pass them along to your ticket buyers. The majority of organizers who pass fees to their buyers pay nothing out of pocket to use Eventbrite! If you choose to use a third party payment processor, you'll be invoiced for your fees.":"En utilisant le traitement des paiements Eventbrite, vous avez la possibilit\u00e9 d'inclure vos frais et de les payer sur vos recettes de billetterie, ou de les transf\u00e9rer aux acheteurs de vos billets. la plupart des organisateurs qui transf\u00e8rent les frais aux participants ne paient au final rien en utilisant Eventbrite ! Si vous choisissez d'utiliser un processeur de paiements tiers, vous serez factur\u00e9 pour vos frais.",
