    "Whenever you create an event, you'll have the opportunity to determine if you want your ticketing or registration page to be \"Public\" or \"Private.\" If you mark it \"Private\", it won't be listed on Eventbrite or any of our partner sites. If you mark it \"Public\", it'll be listed on both to help you reach new audiences.":"Lorsque vous cr\u00e9ez un \u00e9v\u00e9nement, vous aurez la possibilit\u00e9 de d\u00e9terminer si vous voulez que la page de votre \u00e9v\u00e9nement soit \u00ab Publique \u00bb ou \u00ab Priv\u00e9e \u00bb. Si vous la d\u00e9finissez sur \u00ab  Priv\u00e9e \u00bb, elle ne sera pas list\u00e9 sur Eventbrite ni sur aucun de nos sites partenaires. Si vous la d\u00e9finissez sur \u00ab Publique \u00bb, elle sera list\u00e9e \u00e0 la fois sur les deux pour vous aider \u00e0 atteindre de nouveaux publics.",
