    "Yes! Both our Essentials and Professional products are free for free tickets \u2014 we only charge you each time you sell a paid ticket. Organisers with only free events have access to everything in Essentials and Professional.":"Oui ! Les produits Essentials et Professional sont gratuits pour les billets non payants. Nous vous pr\u00e9levons des frais uniquement sur chaque billet payant que vous vendez. Les organisateurs qui ne proposent que des \u00e9v\u00e9nements gratuits ont acc\u00e8s \u00e0 toutes les fonctionnalit\u00e9s du forfait Essentials et Professional.",
    "Yes! Both our Essentials and Professional products are free for free tickets \u2014\u00a0we only charge you each time you sell a paid ticket. Organizers with only free events have access to everything in Essentials, and everything in Professional except for phone, chat, or email support.":"Oui ! Les produits Essentials et Professional sont gratuits pour les billets non payants. Nous vous pr\u00e9levons des frais uniquement sur chaque billet payant que vous vendez. Les organisateurs qui ne proposent que des \u00e9v\u00e9nements gratuits ont acc\u00e8s \u00e0 toutes les fonctionnalit\u00e9s du forfait Essentials, et \u00e0 toutes les fonctionnalit\u00e9s du forfait Professional sauf l'assistance t\u00e9l\u00e9phonique, par chat ou e-mail.",
    "Yes! Both our Essentials and Professional solutions are free for free tickets \u2014 we only charge you each time you sell a paid ticket. All packages come with the ability to pass online ticket fees to attendees. Organisers who exclusively host free events have access to everything in the Essentials and Professional solutions with the exception of phone, chat, or email support. Creators of free events can still find support at our \u003ca href=\"/support\"\u003eOnline Help Centre.\u003c/a\u003e":"Oui ! Les solutions Essentials et Professional sont gratuites pour les billets non payants. Nous vous pr\u00e9levons des frais uniquement sur chaque billet payant que vous vendez. Tous les forfaits viennent avec la possibilit\u00e9 de passer les frais de billets en ligne aux participants. Les organisateurs qui ne proposent que des \u00e9v\u00e9nements gratuits ont acc\u00e8s \u00e0 toutes les fonctionnalit\u00e9s des solutions Essentials et Professional, sauf l'assistance t\u00e9l\u00e9phonique, par chat ou e-mail. Les cr\u00e9ateurs d'\u00e9v\u00e9nements gratuits peuvent toujours trouver de l'aide sur nos \u003ca href=\"/support\"\u003ePages d'aide en ligne.\u003c/a\u003e",
    "Yes! You can change your package at any time. Upgrades will apply immediately to all your live and drafted events, so you can take advantage of Professional product capabilities.  Downgrades will apply only to events created after you make the change.":"Oui ! Vous pouvez changer votre forfait \u00e0 tout moment. Les mises \u00e0 niveau s'appliqueront imm\u00e9diatement \u00e0 tous vos \u00e9v\u00e9nements publi\u00e9s et \u00e0 vos avant-projets pour que vous puissiez profiter des avantages des fonctionnalit\u00e9s du forfait Professional. Les passages \u00e0 la version ant\u00e9rieure s'appliqueront uniquement aux \u00e9v\u00e9nements cr\u00e9\u00e9s apr\u00e8s que vous avez effectu\u00e9 le changement.",
